import logo from './logo.svg';
import './App.css';

function App() {
  document.body.style.background = '../pictures/Europe.png'
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <img src='../pictures/Eu.jpg' alt="Карта" />

      </header>
    </div>
  );
}

export default App;
